      .then((response) => response.json())
      .then((json) => setUsers(json))
      console.log(setUsers);

  }, [])
  return (
    <div className="container">
      <h1>User</h1>
      <div className='card'>
        <div>
        {users.map((user) => (
          <div className='card-inner'>
            <p>{user.name}</p>
            <p>{user.email}</p>

          </div>
        ))}
      </div>
      </div>
    </div>
  )
}

